import React, { Component } from 'react';

export default class Table extends Component {
  render() {
    return (
      <div>
        <table>
          <tr className="justify">
            <th>Descrição</th>
            <th>Tag</th>
            <th>Método de pagamento</th>
            <th>Valor</th>
            <th>Moeda</th>
            <th>Câmbio utilizado</th>
            <th>Valor convertido</th>
            <th>Editar/excluir</th>
          </tr>
          <td>A</td>
        </table>
      </div>
    );
  }
}
